// GoParserInit initializes any static state used to implement GoParser. By default the
// static state used to implement the parser is lazily initialized during the first call to
// NewGoParser(). You can call p function if you wish to initialize the static state ahead
// of time.
func GoParserInit() {
	staticData := &GoParserParserStaticData
	staticData.once.Do(goparserParserInit)
}

// NewGoParser produces a new parser instance for the optional input antlr.TokenStream.
func NewGoParser(input antlr.TokenStream) *GoParser {
	GoParserInit()
	p := new(GoParser)
	p.BaseParser = antlr.NewBaseParser(input)
	staticData := &GoParserParserStaticData
	p.Interpreter = antlr.NewParserATNSimulator(p, staticData.atn, staticData.decisionToDFA, staticData.PredictionContextCache)
	p.RuleNames = staticData.RuleNames
	p.LiteralNames = staticData.LiteralNames
	p.SymbolicNames = staticData.SymbolicNames
	p.GrammarFileName = "GoParser.g4"

	return p
}

